description:
'Introducing... Stan Walker' is the debut Album of Australian Idol 2009 winner Stan Walker. The album consists of songs he performed on Australian Idol 2009, such as Prince's &quot;Purple Rain&quot;, Jeff Buckley's &quot;Hallelujah&quot;, and the smash hit &quot;Black Box&quot;. It also includes a track produced by the original Australian Idol Guy Sebastian.

